import React from 'react'
// eslint-disable-next-line
import { Article, Navbar } from './components'
// eslint-disable-next-line
import { About, Footer, Header, Home, Projects, Services } from './containers'

const App = () => {
  return (
    <div className='App'>
      <div className='gradient__bg'>
        <Navbar/>
        <Header/>
      </div>
    </div>
  )
}

export default App
